import React, { useState } from "react";
import { NavLink } from "react-router-dom";

export default function NavBar() {
  return (
    <>
      <nav>
        <div className="navbar-container">
          <NavLink to="/" className="navbar-logo">
            TRLV <i className="fab fa-typo3"></i>
          </NavLink>
        </div>
      </nav>
    </>
  );
}
